import React from "react";
import '../Navbar.css';
import { Link } from "react-router-dom";
import logo from '../logo.jpg';

function UserNavbar(){
    return(
        <div className="navbody">
            <header>
                <img className="logo" src={logo} alt="logo"></img>
                <nav>
                    <ul className="nav_links">
                        <li><i style={{marginRight:'3px'}} class="fa-solid fa-magnifying-glass"></i><Link to="/user/home">Search</Link></li>
                        <li><i class="fa-solid fa-magnifying-glass"></i><Link to="/user/home">Bookings</Link></li>
                    </ul>
                </nav>
                <a className="cta" href="#"><button>Logout</button></a>
            </header>
        </div>
    )
};

export default UserNavbar;
